import React from "react";

import { Img } from "components";

const ThumbnailPage = () => {
  return (
    <>
      <div className="bg-gray-100 flex flex-col items-center justify-end mx-auto pt-8 sm:px-5 px-8 w-full">
        <Img
          className="h-[1249px] md:h-auto max-w-[1854px] mt-[15px] mx-auto object-cover w-full"
          src="images/img_image3.png"
          alt="imageThree"
        />
      </div>
    </>
  );
};

export default ThumbnailPage;
